        rotateMatrix(mat, N - 1)
    return mat

def rotateMatrix(mat, N):
    for x in range(0, len(mat)):
        for y in range(x, len(mat)):
            temp = mat[x][y]
            mat[x][y] = mat[y][x]
            mat[y][x] = temp
    for x in range(0, len(mat)):
        for y in range(0, int(len(mat) / 2)):
            temp = mat[x][y]
            mat[x][y] = mat[x][len(mat) - y - 1]
            mat[x][len(mat) - y - -1] = temp
    if N > 1:
        rotateMatrix(mat, N - 1)
    return mat
